// src/components/List/ListComponent.jsx
import React, { useContext, useEffect, useState } from "react";
import { FormDataContext } from "../context/FormDataContext";
import "./ListComponent.scss";

const ListComponent = () => {
  const { formDataList } = useContext(FormDataContext);
  const [filteredData, setFilteredData] = useState([]);

  useEffect(() => {
    const now = new Date();
    const filtered = formDataList.filter((item) => {
      const itemDate = new Date(item.timestamp);
      const diff = now - itemDate;
      return diff < 24 * 60 * 60 * 1000; // 24 hours in milliseconds
    });
    setFilteredData(filtered);
  }, [formDataList]);

  return (
    <div className="list-component">
      <h2>Form Data from the Last 24 Hours</h2>
      <ul>
        {filteredData.map((data, index) => (
          <li key={index}>
            <p>Name: {data.name}</p>
            <p>Phone Number: {data.phoneNumber}</p>
            <p>Address: {data.address}</p>
            <p>Timestamp: {new Date(data.timestamp).toLocaleString()}</p>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default ListComponent;
